import React from "react";

const photoPaths = [
  "OIP.jpg", "OIP (1).jpg", "OIP (2).jpg", "OIP (3).jpg", "OIP (4).jpg", "OIP (5).jpg", "OIP (6).jpg"
];

// Optional: Add specific URLs per image if you want to customize
const photoLinks = photoPaths.map((file) => `/images/${file}`); // linking to full-size images

const Photos = () => (
  <div className="w3-padding-64 w3-content" id="photos">
    <h2 className="w3-text-light-grey">My Photos of visiting places</h2>
    <hr style={{ width: "200px" }} className="w3-opacity" />
    <div className="w3-row-padding" style={{ margin: "0 -16px" }}>
      <div className="w3-half">
        {photoPaths.slice(0, 3).map((file, idx) => (
          <a key={idx} href={photoLinks[idx]} target="_blank" rel="noopener noreferrer">
            <img src={`/images/${file}`} style={{ width: "100%", marginBottom: "16px" }} alt="place" />
          </a>
        ))}
      </div>
      <div className="w3-half">
        {photoPaths.slice(3).map((file, idx) => {
          const realIdx = idx + 3; // Adjust index for second column
          return (
            <a key={realIdx} href={photoLinks[realIdx]} target="_blank" rel="noopener noreferrer">
              <img src={`/images/${file}`} style={{ width: "100%", marginBottom: "16px" }} alt="place" />
            </a>
          );
        })}
      </div>
    </div>
  </div>
);

export default Photos;









